import './App.css';
// react에서 사용자 정의 Tag를 만들때는 반드시 대문자로 시작해야 한다.
function Header(props) {
  return <header>
    <h1><a href="/">{props.title}</a></h1>
  </header>
}

function Nav() {
  return <nav>
    <ol>
      <li><a href="/read/1">HTML</a></li>
      <li><a href="/read/2">CSS</a></li>
      <li><a href="/read/3">JS</a></li>
    </ol>
  </nav>
}

function Article() {
  return <article>
    <h2>Welcome</h2>
    Hello, WEB
  </article>
}

function App() {
  return (
    <div>
      <Header title="REACT"></Header>
      <Nav></Nav>
      <Article></Article>
    </div>
  );
}

export default App;
